INSERT INTO `banksoal` VALUES ('77', 'STAFF-PENERBANGAN-UJIAN-3', 'Apron atau Ramp Area adalah bagian dari bandara yang akan digunakan untuk :', 'Loading and unloading Baggage, Cargo, Mail, dan Tempat Parkir Pesawat.', 'unloading Baggage ONLY', 'Loading and unloading Baggage, Cargo, Mail, dan landing Pesawat.', 'Loading and unloading Baggage, Cargo, Mail, dan Taxi  Pesawat.', 'Jawaban A, B, C dan D Benar', 'a', 'Ramp Handling', 'PSPP Jakarta', 'JUNI 2016');
INSERT INTO `banksoal` VALUES ('78', 'STAFF-PENERBANGAN-UJIAN-3', 'Berikut ini adalah beberapa tugas dari Ramp Dispatcher kecuali ?', 'Berkoordinasi dengan petugas AIC dalam hal kebersian interior pesawat.', 'Berkordinasi dengan Petugas teknik dalam hal kondisi pesawat yang di handling.', 'Memeriksa dan memonitor aktivitas di sisi pesawat dan mempastikan bahwa proses bongkar muat  selesai dalam jangka waktu tertentu', 'Membantu pelaksanaan proses check-in.', 'Jawaban A, B, C dan D Benar', 'd', 'Ramp Handling', 'PSPP Jakarta', 'JUNI 2016');
INSERT INTO `banksoal` VALUES ('79', 'STAFF-PENERBANGAN-UJIAN-3', 'Dalam mempersiapkan suatu  penerbangan, Petugas Ramp Dispatcher memperoleh informasi jumlah penumpang harus  berkoordinasi dengan...?', 'Petugaas Chek in', 'Petugas  AIC', 'Petugas GSE', 'Petugas Teknik', 'Jawaban A, B, C dan D Benar', 'a', 'Ramp Handling', 'PSPP Jakarta', 'JUNI 2016');
